import React from 'react'
import Head from 'next/head'



const Home: React.FC = () => {

  // function alerta() {
  //   alert("Teste")
  // }

  return (
    <div className="container">
      <Head>
        <title>Primefox - Get Range IP</title>
      </Head>

      <div className="card">
        <h3>Buscar . . .</h3>
        <input type="text" placeholder="Digite Host ou IP" />
        <button type="submit">Get Range</button>
      </div>

      <div className="bottom">
        <a href="http://primefox.com.br">Primefox</a>
      </div>

    </div>
  )
}

export default Home;
